INSERT INTO `wp_wc_admin_notes` VALUES (1,'new_in_app_marketplace_2021','info','en_US','Customize your store with extensions','Check out our NEW Extensions tab to see our favorite extensions for customizing your store, and discover the most popular extensions in the WooCommerce Marketplace.','{}','unactioned','woocommerce.com','2022-05-05 02:39:35',NULL,0,'plain','',0,0,'info'),(2,'wayflyer_bnpl_q4_2021','marketing','en_US','Grow your business with funding through Wayflyer','Fast, flexible financing to boost cash flow and help your business grow – one fee, no interest rates, penalties, equity, or personal guarantees. Based on your store’s performance, Wayflyer provides funding and analytical insights to invest in your business.','{}','pending','woocommerce.com','2022-05-05 02:39:35',NULL,0,'plain','',0,0,'info'),(3,'wc_shipping_mobile_app_usps_q4_2021','marketing','en_US','Print and manage your shipping labels with WooCommerce Shipping and the WooCommerce Mobile App','Save time by printing, purchasing, refunding, and tracking shipping labels generated by <a href=\"https://woocommerce.com/woocommerce-shipping/\">WooCommerce Shipping</a> – all directly from your mobile device!','{}','pending','woocommerce.com','2022-05-05 02:39:35',NULL,0,'plain','',0,0,'info'),(4,'wc_shipping_mobile_app_q4_2021','marketing','en_US','Print and manage your shipping labels with the WooCommerce Mobile App','Save time by printing, purchasing, refunding, and tracking shipping labels generated by <a href=\"https://woocommerce.com/woocommerce-shipping/\">WooCommerce Shipping</a> – all directly from your mobile device!','{}','pending','woocommerce.com','2022-05-05 02:39:35',NULL,0,'plain','',0,0,'info'),(5,'ecomm-need-help-setting-up-your-store','info','en_US','Need help setting up your Store?','Schedule a free 30-min <a href=\"https://wordpress.com/support/concierge-support/\">quick start session</a> and get help from our specialists. We’re happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.','{}','pending','woocommerce.com','2022-05-05 02:39:35',NULL,0,'plain','',0,0,'info'),(6,'woocommerce-services','info','en_US','WooCommerce Shipping & Tax','WooCommerce Shipping &amp; Tax helps get your store \"ready to sell\" as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.','{}','pending','woocommerce.com','2022-05-05 02:39:35',NULL,0,'plain','',0,0,'info'),(7,'ecomm-unique-shopping-experience','info','en_US','For a shopping experience as unique as your customers','Product Add-Ons allow your customers to personalize products while they\'re shopping on your online store. No more follow-up email requests—customers get what they want, before they\'re done checking out. Learn more about this extension that comes included in your plan.','{}','pending','woocommerce.com','2022-05-05 02:39:35',NULL,0,'plain','',0,0,'info'),(8,'wc-admin-getting-started-in-ecommerce','info','en_US','Getting Started in eCommerce - webinar','We want to make eCommerce and this process of getting started as easy as possible for you. Watch this webinar to get tips on how to have our store up and running in a breeze.','{}','pending','woocommerce.com','2022-05-05 02:39:35',NULL,0,'plain','',0,0,'info'),(9,'your-first-product','info','en_US','Your first product','That’s huge! You’re well on your way to building a successful online store — now it’s time to think about how you’ll fulfill your orders.<br /><br />Read our shipping guide to learn best practices and options for putting together your shipping strategy. And for WooCommerce stores in the United States, you can print discounted shipping labels via USPS with <a href=\"https://href.li/?https://woocommerce.com/shipping\" target=\"_blank\">WooCommerce Shipping</a>.','{}','unactioned','woocommerce.com','2022-05-05 14:30:17',NULL,0,'plain','',0,0,'info'),(10,'wc-admin-optimizing-the-checkout-flow','info','en_US','Optimizing the checkout flow','It’s crucial to get your store’s checkout as smooth as possible to avoid losing sales. Let’s take a look at how you can optimize the checkout experience for your shoppers.','{}','pending','woocommerce.com','2022-05-05 02:39:35',NULL,0,'plain','',0,0,'info'),(11,'wc-admin-first-five-things-to-customize','info','en_US','The first 5 things to customize in your store','Deciding what to start with first is tricky. To help you properly prioritize, we’ve put together this short list of the first few things you should customize in WooCommerce.','{}','unactioned','woocommerce.com','2022-05-09 17:47:36',NULL,0,'plain','',0,0,'info'),(12,'wc-payments-qualitative-feedback','info','en_US','WooCommerce Payments setup - let us know what you think','Congrats on enabling WooCommerce Payments for your store. Please share your feedback in this 2 minute survey to help us improve the setup process.','{}','pending','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(13,'share-your-feedback-on-paypal','info','en_US','Share your feedback on PayPal','Share your feedback in this 2 minute survey about how we can make the process of accepting payments more useful for your store.','{}','pending','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(14,'google_listings_and_ads_install','marketing','en_US','Drive traffic and sales with Google','Reach online shoppers to drive traffic and sales for your store by showcasing products across Google, for free or with ads.','{}','pending','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(15,'wc-subscriptions-security-update-3-0-15','info','en_US','WooCommerce Subscriptions security update!','We recently released an important security update to WooCommerce Subscriptions. To ensure your site’s data is protected, please upgrade <strong>WooCommerce Subscriptions to version 3.0.15</strong> or later.<br /><br />Click the button below to view and update to the latest Subscriptions version, or log in to <a href=\"https://woocommerce.com/my-dashboard\">WooCommerce.com Dashboard</a> and navigate to your <strong>Downloads</strong> page.<br /><br />We recommend always using the latest version of WooCommerce Subscriptions, and other software running on your site, to ensure maximum security.<br /><br />If you have any questions we are here to help — just <a href=\"https://woocommerce.com/my-account/create-a-ticket/\">open a ticket</a>.','{}','pending','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(16,'woocommerce-core-update-5-4-0','info','en_US','Update to WooCommerce 5.4.1 now','WooCommerce 5.4.1 addresses a checkout issue discovered in WooCommerce 5.4. We recommend upgrading to WooCommerce 5.4.1 as soon as possible.','{}','pending','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(17,'wcpay-promo-2020-11','marketing','en_US','wcpay-promo-2020-11','wcpay-promo-2020-11','{}','pending','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(18,'wcpay-promo-2020-12','marketing','en_US','wcpay-promo-2020-12','wcpay-promo-2020-12','{}','pending','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(19,'ppxo-pps-upgrade-paypal-payments-1','info','en_US','Get the latest PayPal extension for WooCommerce','Heads up! There’s a new PayPal on the block!<br /><br />Now is a great time to upgrade to our latest <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">PayPal extension</a> to continue to receive support and updates with PayPal.<br /><br />Get access to a full suite of PayPal payment methods, extensive currency and country coverage, and pay later options with the all-new PayPal extension for WooCommerce.','{}','pending','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(20,'ppxo-pps-upgrade-paypal-payments-2','info','en_US','Upgrade your PayPal experience!','Get access to a full suite of PayPal payment methods, extensive currency and country coverage, offer subscription and recurring payments, and the new PayPal pay later options.<br /><br />Start using our <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">latest PayPal today</a> to continue to receive support and updates.','{}','pending','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(21,'woocommerce-core-sqli-july-2021-need-to-update','update','en_US','Action required: Critical vulnerabilities in WooCommerce','In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(22,'woocommerce-blocks-sqli-july-2021-need-to-update','update','en_US','Action required: Critical vulnerabilities in WooCommerce Blocks','In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(23,'woocommerce-core-sqli-july-2021-store-patched','update','en_US','Solved: Critical vulnerabilities patched in WooCommerce','In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(24,'woocommerce-blocks-sqli-july-2021-store-patched','update','en_US','Solved: Critical vulnerabilities patched in WooCommerce Blocks','In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(25,'habit-moment-survey','marketing','en_US','We’re all ears! Share your experience so far with WooCommerce','We’d love your input to shape the future of WooCommerce together. Feel free to share any feedback, ideas or suggestions that you have.','{}','pending','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(26,'ecomm-wc-navigation-survey','info','en_US','We’d like your feedback on the WooCommerce navigation','We’re making improvements to the WooCommerce navigation and would love your feedback. Share your experience in this 2 minute survey.','{}','pending','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(27,'woocommerce-core-paypal-march-2022-updated','update','en_US','Security auto-update of WooCommerce','<strong>Your store has been updated to the latest secure version of WooCommerce</strong>. We worked with WordPress to deploy PayPal Standard security updates for stores running WooCommerce (version 3.5 to 6.3). It’s recommended to disable PayPal Standard, and use <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">PayPal Payments</a> to accept PayPal.','{}','pending','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(28,'woocommerce-core-paypal-march-2022-updated-nopp','update','en_US','Security auto-update of WooCommerce','<strong>Your store has been updated to the latest secure version of WooCommerce</strong>. We worked with WordPress to deploy security updates related to PayPal Standard payment gateway for stores running WooCommerce (version 3.5 to 6.3).','{}','pending','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(29,'pinterest_03_2022_update','marketing','en_US','Your Pinterest for WooCommerce plugin is out of date!','Update to the latest version of Pinterest for WooCommerce to continue using this plugin and keep your store connected with Pinterest. To update, visit <strong>Plugins &gt; Installed Plugins</strong>, and click on “update now” under Pinterest for WooCommerce.','{}','pending','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(30,'pinterest_gtm_q2_2021','marketing','en_US','Get your products in front of a large, engaged audience','Did you know that shoppers on Pinterest spend twice as much as people on other social platforms? With the new, official Pinterest for WooCommerce, you can turn your product catalog into shoppable Pins and showcase them to 400+ million monthly users looking to buy.','{}','unactioned','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(31,'setup_task_initiative_survey_q2_2022','survey','en_US','We want to know what matters most to you','Take 2 minutes to give us your input on what is important for you while setting up your store and help shape the future of WooCommerce together.','{}','unactioned','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(32,'woocommerce_payments_subscriptions_nopayments_q2_2022','marketing','en_US','Sell subscriptions online – without a paid extension','Say hello to WooCommerce Payments – now with built-in subscriptions functionality. Get free access to the features you need to start earning recurring revenue online. Pay as you go, with no setup costs or monthly fees.','{}','unactioned','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(33,'woocommerce_payments_subscriptions_yespayments_q2_2022','marketing','en_US','Sell subscriptions online – no extra extension required','It\'s here! WooCommerce Payments now features built-in subscriptions functionality. No need to install an extra, paid extension – we\'ve made it simpler than ever to start earning recurring revenue. Ready to grow your business?','{}','pending','woocommerce.com','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(34,'surface_cart_checkout','info','en_US','Apresentando os blocos de Carrinho e Finalização de compra!','Aumente o faturamento da sua loja com os blocos de Carrinho &amp; Finalização de Compra do WooCommerce otimizados para conversão disponíveis na extensão Blocos do WooCommerce.','{}','unactioned','woo-gutenberg-products-block','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(35,'wc-admin-wc-helper-connection','info','en_US','Conectar ao WooCommerce.com','Conecte-se para receber notificações e atualizações importantes do produto.','{}','unactioned','woocommerce-admin','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(36,'wc-admin-navigation-nudge','info','en_US','Agora você tem acesso à navegação do WooCommerce','Estamos introduzindo uma nova navegação para uma experiência de usuário mais intuitiva e aprimorada. Você pode habilitar a versão beta da nova experiência nas configurações avançadas. Ative agora para sua loja.','{}','unactioned','woocommerce-admin','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(37,'wc-admin-complete-store-details','info','en_US','Adicione os detalhes de sua loja para concluir a configuração da loja','Conclua o preenchimento dos detalhes de sua loja com informações importantes de configuração como o endereço base de sua loja','{}','unactioned','woocommerce-admin','2022-05-05 02:39:36',NULL,0,'plain','',0,0,'info'),(38,'storefront-customize','info','en_US','Design your store with Storefront 🎨','Visit the Storefront settings page to start setup and customization of your shop.','{}','unactioned','storefront','2022-05-05 02:41:22',NULL,0,'plain','',0,0,'info'),(39,'wc-admin-launch-checklist','info','en_US','Pronto para lançar sua loja?','Para garantir que você nunca fique com aquela sensação de \"o que eu esqueci\", reunimos uma lista com tudo que é essencial para você verificar antes do lançamento.','{}','unactioned','woocommerce-admin','2022-05-06 02:42:30',NULL,0,'plain','',0,0,'info'),(40,'wc-admin-choosing-a-theme','marketing','en_US','Escolhendo um tema?','Confira os temas compatíveis com o WooCommerce e escolha um alinhado com sua marca e necessidades de negócios.','{}','unactioned','woocommerce-admin','2022-05-06 02:42:30',NULL,0,'plain','',0,0,'info'),(41,'wc-admin-insight-first-product-and-payment','survey','en_US','Insight','Mais de 80% dos novos comerciantes adicionam o primeiro produto e têm pelo menos uma forma de pagamento configurada durante a primeira semana.<br><br>Você acha esse tipo de insight útil?','{}','unactioned','woocommerce-admin','2022-05-06 02:42:30',NULL,0,'plain','',0,0,'info'),(42,'wc-admin-update-store-details','info','en_US','Edite os detalhes de sua loja se necessário','Bom trabalho completando o perfil de sua loja! Você sempre poderá voltar e editar os detalhes que você acabou de compartilhar, se necessário.','{}','unactioned','woocommerce-admin','2022-05-06 02:42:30',NULL,0,'plain','',0,0,'info'),(43,'wc-admin-mobile-app','info','en_US','Instale o aplicativo Woo','Instale o aplicativo do WooCommerce para gerenciar pedidos, receber notificações de vendas e visualizar as principais métricas, onde quer que você esteja.','{}','unactioned','woocommerce-admin','2022-05-09 17:47:36',NULL,0,'plain','',0,0,'info'),(44,'wc-admin-online-clothing-store','info','en_US','Inicie sua loja de roupas online','Iniciar um site de moda é empolgante, mas também pode parecer esmagador. Neste artigo, orientaremos você no processo de configuração, ensinaremos a criar listas bem-sucedidas de produtos e mostraremos como comercializar para seu público-alvo ideal.','{}','unactioned','woocommerce-admin','2022-05-09 17:47:36',NULL,0,'plain','',0,0,'info'),(45,'wc-admin-customizing-product-catalog','info','en_US','Como personalizar seu catálogo do produtos','Você deseja que seu catálogo de produtos e imagens tenham uma ótima aparência e se alinhem à sua marca. Este guia fornecerá todas as dicas necessárias para que seus produtos fiquem ótimos em sua loja.','{}','unactioned','woocommerce-admin','2022-05-09 17:47:36',NULL,0,'plain','',0,0,'info'),(46,'wc-admin-onboarding-payments-reminder','info','en_US','Comece a aceitar pagamentos em sua loja!','Faça pagamentos com o provedor certo para você, escolha entre mais de 100 sistemas de pagamento para o WooCommerce.','{}','unactioned','woocommerce-admin','2022-05-10 03:27:47',NULL,0,'plain','',0,0,'info'),(47,'setup_task_second_survey_q2_2022','survey','en_US','We want to know what matters most to you','Take 2 minutes to give us your input on what is important for you while setting up your store and help shape the future of WooCommerce together.','{}','pending','woocommerce.com','2022-05-10 03:27:48',NULL,0,'plain','',0,0,'info'),(48,'store_setup_survey_survey_q2_2022','survey','en_US','How is your store setup going?','Our goal is to make sure you have all the right tools to start setting up your store in the smoothest way possible.\r\nWe’d love to know if we hit our mark and how we can improve. To collect your thoughts, we made a 2-minute survey.','{}','unactioned','woocommerce.com','2022-05-12 02:40:54',NULL,0,'plain','',0,0,'info'),(49,'wc-update-db-reminder','update','en_US','Atualização do banco de dados WooCommerce concluída','A atualização do WooCommerce está concluída. Obrigado por atualizar para a última versão!','{}','actioned','woocommerce-core','2022-05-11 03:29:18',NULL,0,'plain','',0,1,'info'),(50,'wc-admin-usage-tracking-opt-in','info','en_US','Ajude o WooCommerce a melhorar ativando o rastreamento de uso.','A coleta de dados de uso nos permite melhorar o WooCommerce. Sua loja será considerada à medida que avaliarmos novos recursos, julgarmos a qualidade de uma atualização ou determinarmos se uma melhoria faz sentido. Você sempre pode visitar as <a href=\"http://localhost:8000/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Configurações</a> e optar por parar de compartilhar dados. <a href=\"https://woocommerce.com/usage-tracking?utm_medium=product\" target=\"_blank\">Saiba mais</a> sobre quais dados coletamos.','{}','unactioned','woocommerce-admin','2022-05-12 02:40:53',NULL,0,'plain','',0,0,'info'),(51,'wc-admin-insight-first-sale','survey','en_US','Você sabia?','Uma loja com tecnologia WooCommerce precisa, em média, de 31 dias para obter a primeira venda. Você está no caminho certo! Você acha esse tipo de insight útil?','{}','unactioned','woocommerce-admin','2022-05-12 02:40:53',NULL,0,'plain','',0,0,'info');
